('Lynch, Ryan S. <i>et al.</i>', 'Six New Recycled Globular Cluster Pulsars Discovered with the Green Bank Telescope', 'The Astrophysical Journal, Volume 734, Issue 2, article id. 89, 8 pp.', 'http://adsabs.harvard.edu/abs/2011ApJ...734...89L', 318, '2013-01-07 10:16:21', 2011, '', '2013-01-07', NULL, NULL, 'http://journalfire.com/node/17255305', NULL, 27),
('Conroy, Kyle E', 'Variable Stars in the Globular Cluster M14', 'Journal of the Southeastern Association for Research in Astronomy, vol. 5, p. 34-42', 'http://adsabs.harvard.edu/abs/2012JSARA...5...34C', 319, '2013-01-09 11:31:54', 2012, '', '2013-01-09', NULL, NULL, NULL, NULL, 15),
('Wehlau, Amelia; Froelich, Norma', 'The variables of M14', 'The Astronomical Journal, vol. 108, no. 1, p. 134-154', 'http://adsabs.harvard.edu/abs/1994AJ....108..134W', 320, '2013-01-09 11:35:24', 1994, '', '2013-01-09', NULL, NULL, 'http://journalfire.com/node/21924203', NULL, 9),
('Robinson, W. H.', 'Nebula N.G.C. 6535, note on the', 'MNRAS, Vol. 59, p.538', 'http://adsabs.harvard.edu/abs/1899MNRAS..59..538R', 321, '2013-01-10 16:22:58', 1899, '', '2013-01-10', NULL, NULL, NULL, NULL, 4),
('Hazen, Martha L.; Hesser, Betty Hinsdale', 'The variable stars in the globular cluster NGC 6388', 'Astronomical Journal, vol. 92, p. 1094-1099', 'http://adsabs.harvard.edu/abs/1986AJ.....92.1094H', 324, '2013-01-23 11:11:33', 1986, '', '2013-01-23', NULL, NULL, NULL, NULL, 13),
('Moehler, S.; Sweigart, A. V.; Catelan, M.', 'Blue horizontal branch stars in metal-rich globular clusters. I. NGC 6388 and NGC 6441', 'Astronomy and Astrophysics, v.351, p.519-525', 'http://adsabs.harvard.edu/abs/1999A%26A...351..519M', 325, '2013-01-23 11:16:28', 1999, '', '2013-01-23', NULL, NULL, 'http://journalfire.com/node/16158487', NULL, 5),
('Beccari, G. <i>et al.</i>', 'The Dynamical State and Blue Straggler Population of the Globular Cluster NGC 6266 (M62)', 'The Astronomical Journal, Volume 131, Issue 5, pp. 2551-2560', 'http://adsabs.harvard.edu/abs/2006AJ....131.2551B', 326, '2013-02-19 17:24:14', 2006, '', '2013-02-19', NULL, NULL, 'http://journalfire.com/node/68583154', NULL, 13),
('McNamara, Bernard J.; McKeever, Jean', 'The Dynamical Distance, RR Lyrae Absolute Magnitude, and Age of the Globular Cluster NGC 6266', 'The Astronomical Journal, Volume 142, Issue 5, article id. 163, 4 pp.', 'http://adsabs.harvard.edu/abs/2011AJ....142..163M', 327, '2013-02-19 17:33:28', 2011, '', '2013-02-19', NULL, NULL, 'http://journalfire.com/node/19995884', NULL, 12),
('Hazen, Martha L.', 'A Search for Variable Stars in the Globular Clusters NGC 5694 and NGC 6558', 'Astronomical Journal v.111, p.1184', 'http://adsabs.harvard.edu/abs/1996AJ....111.1184H', 328, '2013-03-05 14:27:59', 1996, '', '2013-03-05', NULL, NULL, 'http://journalfire.com/node/68514544', NULL, 13),
('Davies, Ben <i>et al.</i>', 'GLIMPSE-CO1: the most massive intermediate-age stellar cluster in the Galaxy', 'MNRAS 411, 1386', 'http://adsabs.harvard.edu/abs/2011MNRAS.411.1386D', 329, '2013-03-12 10:33:46', 2011, '', '2013-03-12', NULL, NULL, 'http://journalfire.com/node/90716877', 'The stellar cluster GLIMPSE-C01 is a dense stellar system located in the Galactic plane. Though often referred to in the literature as an old globular cluster traversing the Galactic disc, previous observations do not rule out that it is an intermediate-age (less than a few Gyr) disc-borne cluster. Here, we present high-resolution near-infrared spectroscopy of over 50 stars in the cluster. We find an average radial velocity is consistent with being part of the disc, and determine the cluster''s dynamical mass to be (8  3)  104 Msun. Analysis of the cluster''s M/L ratio, the location of the red clump and an extremely high stellar density, all suggest an age of 400-800 Myr for GLIMPSE-C01, much lower than that for a typical globular cluster. This evidence therefore leads us to conclude that GLIMPSE-C01 is a part of the disc population, and is the most massive Galactic intermediate-age cluster discovered to date.', 30),
('McNamara, Bernard J. <i>et al.</i>', 'A Search for an Intermediate-mass Black Hole in the Core of the Globular Cluster NGC 6266', 'The Astrophysical Journal, Volume 745, pag. 175', 'http://adsabs.harvard.edu/abs/2012ApJ...745..175M', 330, '2013-04-02 10:44:13', 2012, '', '2013-04-02', NULL, NULL, 'http://journalfire.com/node/1946849', 'It has long been thought that intermediate-mass black holes (IMBHs) might be located in the cores of globular clusters. However, studies attempting to confirm this possibility have been inconclusive. To refine the search for these objects, Baumgardt et al. completed a series of N-body simulations to determine the observational properties that a host globular cluster should possess. Keys to revealing the presence of an IMBH were found to be the shape of the cluster''s core proper motion dispersion profile and its surface density profile... ', 13),
('Lee, Jae-Woo; Carney, Bruce W.', 'Chemical Abundances of Three Metal-poor Globular Clusters (NGC 6287, NGC 6293, and NGC 6541) in the Inner Halo', 'The Astronomical Journal, Volume 124, Issue 3, pp. 1511-1527', 'http://adsabs.harvard.edu/abs/2002AJ....124.1511L', 331, '2013-04-10 11:14:44', 2002, '', '2013-04-10', NULL, NULL, 'http://journalfire.com/node/26253895', 'We present a chemical abundance study of three inner old halo clusters, NGC 6287, 6293, and 6541, finding [Fe/H]=-2.01+/-0.05, -1.99+/-0.02, and -1.76+/-0.02 (internal), respectively, and our metallicity measurements are in good agreement with previous estimates. We also present the radial velocity measurements of the clusters. Our radial velocity measurements for NGC 6293 and NGC 6541 are in good agreement with previous measurements; however, our radial velocity measurement for NGC 6287 is almost 80 km s-1 larger than the previous measurement. The mean alpha-element abundances of our program clusters are in good agreement with other globular clusters, confirming previous results. However, the individual alpha-elements appear to follow different trends...', 5),
('Guillot, Sebastien', 'Chandra Observation of Quiescent Low-Mass X-Ray Binaries in the Globular Cluster NGC 6304', 'The Astrophysical Journal, Volume 699, Issue 2, pp. 1418-1422', 'http://adsabs.harvard.edu/abs/2009ApJ...699.1418G', 332, '2013-04-15 10:33:09', 2009, '', '2013-04-15', NULL, NULL, 'http://journalfire.com/node/49805440', 'This paper presents the analysis of candidate low-mass X-ray binaries in quiescence (qLMXBs) observed during a short Chandra/ACIS observation of the globular cluster (GC) NGC 6304. Two out of the three candidate qLMXBs of this cluster, XMMU 171433-292747 and XMMU 171421-292917, lie within the field of view. This permits comparison with the discovery observation of these sources. The one in the GC coreXMMU 171433-292747is spatially resolved into two separate X-ray sources, one of which is consistent with a pure H-atmosphere qLMXB, and the other is an X-ray power-law spectrum source. These two spectral components separately account for those observed from XMMU 171433-292747 in its discovery observation...', 3),
('Terzan, A.', 'Four new star clusters in the direction of the central area of the Galaxy', 'Astronomy and Astrophysics, Vol. 12, p. 477 - 481', 'http://adsabs.harvard.edu/abs/1971A%26A....12..477T', 333, '2013-04-16 10:21:36', 1971, '', '2013-04-16', NULL, NULL, NULL, NULL, 8),
('Stacey, W. S <i>et al.</i>', 'An Examination of the X-Ray Sources in the Globular Cluster NGC 6652', 'The Astrophysical Journal, Volume 751, Issue 1, article id. 62, 13 pp.', 'http://adsabs.harvard.edu/abs/2012ApJ...751...62S', 334, '2013-04-22 16:14:00', 2012, '', '2013-04-22', NULL, NULL, 'http://journalfire.com/node/20882706', 'We observed the globular cluster NGC 6652 with Chandra for 47.5 ks, detecting six known X-ray sources, as well as five previously undetected X-ray sources. Source A (XB 1832-330) is a well-known bright low-mass X-ray binary (LXMB). The second brightest source, B, has a spectrum that fits well to either a power-law model  or an absorbed hot gas emission model...', 9),
('Terzan, A.; Rutily, B.', 'Globular clusters NGC 6304 and NGC 6401', 'Astronomy and Astrophysics, Vol. 16, p. 408 - 416', 'http://adsabs.harvard.edu/abs/1972A%26A....16..408T', 335, '2013-04-23 13:58:19', 1972, '', '2013-04-23', NULL, NULL, NULL, NULL, 3),
('Alcaino, G.', 'The globular cluster NGC 6626', 'Astronomy and Astrophysics Supplement Series, vol. 44, p. 191-197', 'http://adsabs.harvard.edu/abs/1981A%26AS...44..191A', 336, '2013-04-24 16:01:06', 1981, '', '2013-04-24', NULL, NULL, NULL, 'A color-magnitude diagram (CMD) for NGC 6626 was obtained from 311 stars measured photographically, calibrated from a photoelectric sequence of 23 stars to a limiting magnitude of V equals 16.47. In a dense stellar field at low galactic latitude, the CMD consists of a giant branch of medium steepness and a group of only blue horizontal branch stars. The deduced reddening of E(B-V) equals 0.40 places the object at 5.8 kpc from the sun, 0.6 kpc from the galactic plane, and 3.5 kpc from the galactic center. The inferred values of Delta V of about 2.6 and S of about 4.3 are consistent with a moderately metal-poor metal abundance as are also the spectral type F8, the integrated color Q equals -0.35, and Fe/H of about 1.3.', 3),
('Stephens, Andrew W.; Frogel, Jay A.', 'An Infrared Spectroscopic Study of Eight Galactic Globular Clusters', 'The Astronomical Journal, Volume 127, Issue 2, pp. 925-937', 'http://adsabs.harvard.edu/abs/2004AJ....127..925S', 337, '2013-04-26 11:49:35', 2004, '', '2013-04-26', NULL, NULL, NULL, 'We have obtained medium-resolution infrared K-band spectra of 44 giants in seven heavily reddened clusters in the Galactic bulge, as well as 12 giants in Omega Centauri. We measure the equivalent widths of the Na doublet, the Ca triplet, and the CO band head, and then apply the new technique of Frogel et al. to determine the metallicity of each star. Averaging these values, we estimate the metallicity for each cluster and compare our new [Fe/H] values with previous determinations from the literature. Our estimates for each cluster are NGC 6256 (-1.35), NGC 6539 (-0.79), HP 1 (-1.30), Liller 1 (-0.36), Palomar 6 (-0.52), Terzan 2 (-0.87), and Terzan 4 (-1.62). We briefly discuss differences between the various [Fe/H] scales on which it was possible to base our calibration, which is found to be the largest uncertainty in using this technique to determine metallicities.', 9);
