('NGC 4147', '', '', 'latitude=18.541806&longitude=2.526166&zoom=12', 'Globular cluster NGC 4147 was discovered by William Herschel on March 14, 1784 and cataloged as H I.19.\r\n<p>\r\nThis cluster is perhaps a former member of the Sagittarius Dwarf Elliptical Galaxy (SagDEG), or Sagittarius Dwarf Spheroidal Galaxy (Sgr dSph), the nearby dwarf galaxy discovered in 1994, which is currently in a close and perhaps final encounter before its tidal disruption, with our Milky Way Galaxy. ', 'SEDS', 'http://spider.seds.org/spider/MWGC/n4147.html', '2012-12-28 16:05:08'),
