INSERT INTO `infousers` (`numcomm`, `ID`, `datacomm`, `nomeuser`, `commento`, `intestazione`) VALUES
(1, 'NGC 6205', '2003-02-18', 'Francisco Violat Bordonau', 'We have confirmed the variability of L629, a new\nvariable star Red Giant (suspected variable star from\n2000, June, in Osborn''s paper), located in M13.  \n<p>      \nWith the idea to search, measure and to determine the\npresent parameters of new variable stars in M13 we\nhave studied M13 during a period of 521days (of DJ\n2.452.076 to DJ 2.452.596, both inclusively), and\nmeasured during 129 nights (DJ 2.452.076 to 52.204) in\n2001, and other 189 nights (DJ 2.452.408 to 52.596) in\n2002 the brightness of 35 different stars between\nvariable, suspected variable and comparison stars,\nwith telescopes of 30.2 and 20.3-cm, and CCD cameras\n(filter V Johnson), from Spain.\n<p>\nWe have light curves of brightness, periodogram and\nmeasurements of L629 that characterize it as a new\nvariable star of Red Giante type.', 'Variability of L629 confirmed');
