('NGC 6397', '[ESO Press Release,17 August 2004] \nHow Old is the Milky Way ? \nVLT Observations of Beryllium in Two Old Stars Clock the Beginnings ', 'Observations by an international team of astronomers  with the UVES spectrometer on ESO''s Very Large Telescope at the Paranal Observatory (Chile) have thrown new light on the earliest epoch of the Milky Way galaxy.', 'http://www.eso.org/outreach/press-rel/pr-2004/pr-20-04.html', 'http://www.eso.org/outreach/press-rel/pr-2004/images/phot-23a-04-preview.jpg', '2004-08-20'),
('NGC 6656', 'A nice image of M22, taken with a 75 mm telescope.', 'The image was taken recently in Italy, locality "Monte Pollino" (Basilicata) by <b>Raffaele Castellano</b>. Courtesy of  <a href="http://www.astrocampania.org/">\r\nAstrocampania.</a>', 'http://www.mporzio.astro.it/~marco/gc/foto/M22web.jpg', 'http://www.mporzio.astro.it/~marco/gc/foto/M22web.jpg', '2004-08-24'),
('NGC 6205', 'A beautiful image of M13, by "AstroJoe"', 'A nice photo of the globular cluster M13 taken from the city of  Salerno  (Italy) by "AstroJoe" with an amatorial telescope.', 'http://img69.exs.cx/img69/4879/M13med.jpg', 'http://img69.exs.cx/img69/4879/M13med.jpg', '2004-10-07'),
('NGC 5272', 'M3 Variable Star Movies', 'A nice movie created from several images by Joel D. Hartman, that allow you to see some variable stars in M3', 'http://cfa-www.harvard.edu/~jhartman/M3_movies.html', 'http://cfa-www.harvard.edu/~jhartman/M3_color3.gif', '2004-10-19'),
('NGC 6093', 'Hubble Images a Swarm of Ancient Stars', 'This stellar swarm is M80 (NGC 6093), one of the densest of the 147 known globular star clusters in the Milky Way galaxy. Located about 28, 000 light-years from Earth, M80 contains hundreds of thousands of stars...', 'http://www.spacetelescope.org/images/html/opo9926a.html', 'http://www.mporzio.astro.it/~marco/gc/foto/opo9926a.jpg', '2005-05-20'),
('NGC 2808', 'NGC 2808 at astrosurf.com', 'A beautiful image of the cluster....', 'http://www.astrosurf.com/antilhue/ngc2808.htm', 'http://www.astrosurf.com/antilhue/NGC2808-LRGBhi.jpg', '2005-07-11'),
('NGC 6205', 'APOD: August 19, 1998 - M13', 'From "Astronomy Picture of the Day": M13 is one of the most prominent and best known globular clusters...', 'http://antwrp.gsfc.nasa.gov/apod/ap980819.html', NULL, '2005-07-11'),
('NGC 5139', 'Peering into the Core of a Globular Cluster', 'Astronomers have used NASA''s Hubble Space Telescope to peer into the center of a dense swarm of stars called Omega Centauri...', 'http://www.spacetelescope.org/images/html/opo0133a.html', NULL, '2005-07-12'),
('NGC 104', 'Chandra Finds Long-Sought Link to Origin of Millisecond Pulsars', 'New intersting results from Chandra X-Ray Observatory about Millisecond Pulsars (Image Credit: X-ray: NASA/CXC/Northwestern U./C.Heinke et al.; Optical: ESO/Danish 1.54-m/W.Keel et al. ..)', 'http://chandra.harvard.edu/photo/2005/47tuc/', 'http://img332.imageshack.us/img332/6286/47tucmed0jm.jpg', '2005-07-21'),
('<i>Milky Way</i>', 'A New Star Cluster!', 'Using an automated computer method to sift through data collected by NASA''s Spitzer Space Telescope, astronomers on the Galactic Legacy Infrared Mid-Plane Survey Extraordinaire (GLIMPSE) team found a new star cluster in our Milky Way galaxy,  in the northern constellation Aquila...', 'http://www.spitzer.caltech.edu/Media/mediaimages/sig/sig05-024.shtml', 'http://img494.imageshack.us/img494/2929/sig05024small4xi.jpg', '2005-12-27'),
('NGC 6218', 'VLT Study Reveals Troubled Past of Globular Cluster Messier 12', 'Based on observations with ESO''s Very Large Telescope, a team of Italian astronomers reports [1] that the stellar cluster Messier 12 must have lost to our Milky Way galaxy close to one million low-mass stars.', 'http://www.eso.org/outreach/press-rel/pr-2006/pr-04-06.html', 'http://img75.imageshack.us/img75/8895/phot04a06preview1fk.jpg', '2006-02-07'),
('NGC 5466', 'A River of Stars Streaming Across the Northern Sky', 'Astronomers have discovered a narrow stream of stars extending at least 45 degrees across the northern sky. The stream is about 76,000 light-years distant from Earth and forms a giant arc over the disk of the Milky Way galaxy...', 'http://pr.caltech.edu/media/Press_Releases/PR12811.html', NULL, '2006-03-20'),
('NGC 104', 'The Toucan''s Diamond:  VLT Image of a Unique Swarm of Stars, 47 Tuc', 'The Southern constellation Tucana (the Toucan) is probably best known as the home of the Small Magellanic Cloud, one of the satellite galaxies of the Milky Way. But Tucana also hosts another famous object that shines thousands of lights, like a magnificent, oversized diamond in the sky: the globular cluster 47 Tucanae. More popularly known as 47 Tuc, it is surpassed in size and brightness by only one other globular cluster, Omega Centauri....', 'http://www.eso.org/outreach/press-rel/pr-2006/pr-20-06.html', 'http://img214.imageshack.us/img214/6991/phot2006preview9hy.jpg', '2006-06-13'),
('FSR 1735', 'New Globular Cluster Found in Milky Way', 'Images made with ESO''s New Technology Telescope at La Silla by a team of German astronomers reveal a rich circular cluster of stars in the inner parts of our Galaxy. Located 30,000 light-years away, this previously unknown closely-packed group of about 100,000 stars is most likely a new globular cluster.\r\n\r\n', 'http://www.eso.org/outreach/press-rel/pr-2007/pr-12-07.html', 'http://www.eso.org/outreach/press-rel/pr-2007/images/phot-12-07-icon.jpg', '2007-03-27'),
('NGC 5272', ' M3: Inconstant Star Cluster ', 'Star clusters appear constant because photographs of them are frozen in time. In reality, though, cluster stars swarm the center and frequently fluctuate in brightness... (from APOD website)', 'http://antwrp.gsfc.nasa.gov/apod/ap070415.html', 'http://img225.imageshack.us/img225/690/m3moviestanekce5.gif', '2007-04-16'),
('NGC 5139', ' NGC 5139: Omega Centauri (from APOD)', ' Centaurus is one of the most striking constellations in the southern sky. The Milky Way flows through this celestial expanse whose wonders also include the closest star system to the Sun, Alpha Centauri, and the largest globular star cluster in our galaxy, Omega Centauri (aka NGC 5139)...', 'http://antwrp.gsfc.nasa.gov/apod/ap070419.html', 'http://img136.imageshack.us/img136/7695/omcver1c720ol7.jpg', '2007-04-19'),
('NGC 2808', 'Hubble Finds Multiple Stellar ''Baby Booms'' in a Globular Cluster', 'Astronomers have long thought that globular star clusters had a single "baby boom" of stars early in their lives and then settled into a quiet existence. But new observations by NASA''s Hubble Space Telescope of the massive globular cluster NGC 2808 provide evidence that star birth went "boom, boom, boom," with three generations of stars forming very early in the cluster''s life.<br><i>Image Credit: NASA, ESA, A. Sarajedini (University of Florida) and G. Piotto (University of Padua [Padova])</i>', 'http://hubblesite.org/newscenter/archive/releases/2007/18/', 'http://img387.imageshack.us/img387/4151/smallwebrt7.jpg', '2007-05-02'),
('NGC 6205', 'M13 The Hercules Globular Cluster', 'At its distance of 25,100 light years, its angular diameter of 20&#8242; corresponds to a linear 145 light years - visually, it is perhaps 13&#8242; large. It contains several 100,000 stars; Timothy Ferris in his book Galaxies even says ?more than a million?...', 'http://bongo69.wordpress.com/2007/06/05/m13-the-hercules-globular-cluster/', 'http://bongo69.files.wordpress.com/2007/06/m-13.jpg', '2007-06-06'),
('NGC 5272', ' Globular Star Cluster M3 at APOD', 'This immense ball of half a million stars older than the Sun lies over 30,000 light-years away. Cataloged as M3 (and NGC 5272), it is one of about 150 globular star clusters that roam the halo of our Milky Way Galaxy...', 'http://www.brera.mi.astro.it/apod/ap070609.html', 'http://img356.imageshack.us/img356/3769/m3teuwen720le8xt5.jpg', '2007-06-12'),
('NGC 5139', 'Black hole found in enigmatic Omega Centauri', 'Omega Centauri has been known as an unusual globular cluster for a long time. A new result obtained by the NASA/ESA Hubble Space Telescope and the Gemini Observatory reveals that the explanation behind Omega Centauri''s peculiarities may be a black hole hidden in its centre...', 'http://www.spacetelescope.org/news/html/heic0809.html', 'http://img355.imageshack.us/img355/44/heic0809ala7.jpg', '2008-04-04'),
('NGC 104', 'Closer to the Heart - 47 Tucanae', 'What you see here is 47 Tucanae, the second largest globular cluster in the Milky Way''s busy galactic halo...', 'http://www.universetoday.com/2008/05/19/closer-to-the-heart-47-tucanae', NULL, '2008-05-22'),
('NGC 104', '47 Tuc: A Great Globular Cluster of Stars  ', 'Stars come in bunches. Of the over 200 globular star clusters that orbit the center of our Milky Way Galaxy, 47 Tucanae is the second brightest globular cluster (behind Omega Centauri)...', 'http://antwrp.gsfc.nasa.gov/apod/ap080826.html', NULL, '2008-09-01'),
('NGC 6522', 'NGC 6522 and NGC 6528 on Flickr\r\n', 'This fascinating pair of globular clusters lie together just beyond the spout of the Saggitarius teapot, and from our earthly vantage point they are separated by only 16 arcminutes...', 'http://www.flickr.com/photos/djmccrady/2557936418/', 'http://i99.photobucket.com/albums/l310/marcolinux/2557936418_30d75a2385_m.jpg', '2008-11-08'),
('NGC 6522', 'Frog Rock Obs., NGC 6522 and 6528', 'Situated between Gamma and W Sagittarius, the faint background stars around NGC 6522 are seen through what is known as Baade''s window...', 'http://my.hwy.com.au/~sjquirk/images/gstar/ngc6522.html', NULL, '2008-11-09'),
('NGC 6205', 'M13 Globular Cluster ', 'An image by Gianluca Pompeo', 'http://pompeo.rigelcomputers.com/gallery/displayimage.php?album=8&pos=0', '', '2008-11-17'),
('NGC 6656', 'M22 Globular Cluster', 'An image by Gianluca Pompeo', 'http://pompeo.rigelcomputers.com/gallery/displayimage.php?album=8&pos=1', NULL, '2008-11-17'),
('NGC 5272', 'Globular Cluster M3', 'An image by Gianluca Pompeo', 'http://pompeo.rigelcomputers.com/gallery/displayimage.php?album=8&pos=2', NULL, '2008-11-17'),
('NGC 5139', 'Omega Centauri: the glittering giant of the southern skies', 'Omega Centauri is one of the finest jewels of the southern hemisphere night sky, as ESO''s latest stunning image beautifully illustrates. Containing millions of stars, this globular cluster is located roughly 17 000 light-years from Earth in the constellation of Centaurus.', 'http://www.eso.org/public/outreach/press-rel/pr-2008/pr-44-08.html', NULL, '2008-12-03'),
('NGC 6205', 'A Celestial Snow Globe of Stars', 'Like a whirl of shiny flakes sparkling in a snow globe, NASA''s Hubble Space Telescope catches an instantaneous glimpse of many hundreds of thousands of stars moving about in the globular cluster M13, one of the brightest and best-known globular clusters in the northern sky', 'http://hubblesite.org/newscenter/archive/releases/2008/40/', NULL, '2008-12-04'),
('NGC 6121', 'M4: The Closest Known Globular Cluster ', 'A beautiful image of the cluster, taken from APOD', 'http://apod.nasa.gov/apod/ap000523.html', NULL, '2010-06-10'),
('NGC 6093', 'Scientists get a look at the birth of the Milky Way', 'An image of the globular star cluster M80 (NGC 6093) made using the Hubble Space Telescope. M80 contains hundreds of thousands of stars and is one of 147 globular clusters known to be associated with the Milky Way. Credit: The Hubble Heritage Team / AURA / STScI / NASA', 'http://www.physorg.com/news196363935.html', 'http://img85.imageshack.us/img85/1137/6scientistsge.jpg', '2010-06-10'),
('NGC 5139', 'Hubble Data Used to Look 10,000 Years into the Future', '"astronomers have made the most accurate measurements yet of the motions of more than 100,000 cluster inhabitants, the largest survey to date to study the movement of stars in any cluster..."', 'http://hubblesite.org/newscenter/archive/releases/2010/28/', NULL, '2010-10-26'),
('NGC 6624', 'Core of the Globular Cluster NGC 6624', 'Images of NGC 6624 from HubbleSite gallery', 'http://hubblesite.org/gallery/album/pr1993020a/', NULL, '2011-03-21'),
('NGC 6624', 'Core of the Globular Cluster NGC 6624', '"This is a comparison of pictures of the core of the globular cluster NGC 6624, as imaged with the European Space Agency''s Faint Object Camera aboard NASA''s Hubble Space Telescope"', 'http://hubblesite.org/newscenter/archive/releases/1993/20/', NULL, '2011-03-21'),
('Djorg 2', 'IR color magnitude diagram ', 'An IR CM diagram from the Bologna compilation', 'http://www.bo.astro.it/~GC/ir_archive/djo2pag.html', 'http://www.bo.astro.it/~GC/ir_archive/djo2web.jpg', '2011-03-24'),
('NGC 6838', 'Messier 71: an Unusual Globular Cluster', '"This spectacular NASA/ESA Hubble Space Telescope image shows a bright scattering of stars in the small constellation of Sagitta (the Arrow). This is the centre of the globular cluster Messier 71.."', 'http://www.spacetelescope.org/images/potw1018a/', NULL, '2011-06-09'),
('NGC 6981', 'M72: A Globular Cluster of Stars', 'A fascinating view of the globular cluster M72, via APOD (Credits: NASA, ESA, Hubble, HPOW)', 'http://apod.nasa.gov/apod/ap100512.html', 'http://img651.imageshack.us/img651/8749/m72hst.jpg', '2011-07-05'),
('NGC 7006', 'A Remote Outpost of the Milky Way', 'A clear image of this "neglected" cluster, via the Hubble Space Telescope', 'http://www.spacetelescope.org/images/potw1137a/', NULL, '2011-09-12'),
('NGC 6256', 'Near IR photometric DB', 'The page of NGC 6256', 'http://www.bo.astro.it/~GC/ir_archive/6256pag.html', NULL, '2012-01-24'),
('UKS 1', 'Obscure Globular Clusters of the Milky Way: Terzan Clusters and the Faintest Globular UKS-1', 'An Observational and Imaging Success, by Barbara Wilson', 'http://www.astronomy-mall.com/Adventures.In.Deep.Space/obscure.htm', 'http://img.skitch.com/20120316-ss34g4u85dbsi9yrm5gigbgb9.jpg', '2012-03-16'),
('NGC 6205', 'M13: The Great Globular Cluster in Hercules ', '... M13 is now modestly recognized as the Great Globular Cluster in Hercules, one of the brightest globular star clusters in the northern sky. ', 'http://apod.nasa.gov/apod/ap120614.html', NULL, '2012-06-15'),
('NGC 6121', 'A Cluster with a Secret', '"A new image from ESOs La Silla Observatory in Chile shows the spectacular globular star cluster Messier 4. This ball of tens of thousands of ancient stars is one of the closest and most studied of the globular clusters and recent work has revealed that one of its stars has strange and unexpected properties, apparently possessing the secret of eternal youth."', 'http://www.eso.org/public/news/eso1235/', NULL, '2012-09-11'),
('NGC 6254', 'Globular Cluster M 10', 'Hubble has observed the brightest part of the centre of the cluster in this image, a region which is about 13 light-years across.', 'http://www.spacetelescope.org/images/potw1225a/', 'http://gclusters.altervista.org/foto/M10.jpg', '2012-09-19'),
('NGC 6779', 'A collection of ancient stars', 'The NASA/ESA Hubble Space Telescope has produced this beautiful image of the globular cluster Messier 56 (also known as M 56 or NGC 6779), which is located about 33 000 light years away from the Earth in the constellation of Lyra (The Lyre). ', 'http://spacetelescope.org/images/potw1234a/', 'http://gclusters.altervista.org/foto/ngc6779.jpg', '2012-09-20'),
('NGC 6626', 'M28 (NGC 6626)', 'A beautiful image on Astropleiades', 'http://astropleiades.e-monsite.com/pages/abecedaire/le-catalogue-messier/m28-ngc-6626.html', '', '2012-09-25'),
('NGC 2419', 'ADS paper', 'Paper on the interpretation of the HB of NGC2419 in the context of multiple population in globular clusters', 'http://adsabs.harvard.edu/abs/2011MNRAS.414.3381D', '', '2012-09-28'),
('NGC 6637', 'Cosmic riches', 'This dazzling image shows the globular cluster Messier 69, or M 69 for short, as viewed through the NASA/ESA Hubble Space Telescope...', 'http://spacetelescope.org/images/potw1240a/', 'http://gclusters.altervista.org/foto/dazzling69.jpg', '2012-10-02'),
('NGC 6397', 'Ground-based Image of Globular Cluster NGC 6397', 'A beautiful ground-based Image of Globular Cluster NGC 6397', 'http://spacetelescope.org/images/opo0742b/', '', '2012-10-03'),
('NGC 6362', 'The globular star cluster NGC 6362', 'This colourful view of the globular cluster NGC 6362 was captured by the Wide Field Imager attached to the MPG/ESO 2.2-metre telescope at ESOs La Silla Observatory in Chile. This brilliant ball of ancient stars lies in the southern constellation of Ara (The Altar).', 'http://www.eso.org/public/news/eso1243/', 'http://gclusters.altervista.org/foto/eso1243a-1.jpg', '2012-11-19'),
('NGC 104', 'A Jumble of Exotic Stars ', '"This new infrared image from ESOs VISTA telescope shows the globular cluster 47 Tucanae in striking detail. This cluster contains millions of stars, and there are many nestled at its core that are exotic and display unusual properties..."', 'http://www.eso.org/public/news/eso1302/', '', '2013-01-14'),
('NGC 6205', 'M 13  Her @ Virtualtelescope', 'A total of 40 exposures, with 90 seconds of integration each and taken with the Planewave 17 unit, were averaged...', 'http://www.virtualtelescope.eu/2012/08/24/m-13-her/', '', '2013-01-18'),
('NGC 6981', 'M72: A Globular Cluster of Stars ', 'Hubble Space Telescope shows us about 100,000 of stars from M72', 'http://apod.nasa.gov/apod/ap120819.html', '', '2013-03-07'),
('NGC 5139', 'The greatest of all...', '"Of the 200 or so globular clusters that survive today, Omega Centauri is the largest, containing over ten million stars...."', 'http://apod.nasa.gov/apod/ap130501.html', '', '2013-05-01');
